import React from 'react';

import classes from './Card.module.css';

const card = ( props ) => {
    return (
        <tr>
            <td className={classes.Feira}>
                Nome: {props.nome}
            </td>
            <td className={classes.Feira}>
                Descrição: {props.descr}
            </td>
        </tr>
    );
};

export default card;
